id: seo-detect

info:
  name: seo-detect
  author: ffffffff0x
  severity: high
  description: |
    SEO检测
    字典来自 https://github.com/ffffffff0x/AboutSecurity/blob/master/Dic/Regular/seo/seo_word.txt
    明文一份,html实体编码一份
  tags: smart,seo

requests:
  - method: GET
    path:
      - "{{BaseURL}}"
    headers:
      User-agent: "{{headers}}"

    payloads:
      headers:
        - 'Mozilla/5.0 (compatible; Baiduspider/2.0;http://www.baidu.com/search/spider.html)'
        - 'Mozilla/5.0 (compatible; Googlebot/2.1; +http://www.google.com/bot.html)'
        - 'Googlebot/2.1 (+http://www.google.com/bot.html)'
        - 'Sogou web spider/3.0(+http://www.sogou.com/docs/help/webmasters.htm#07)'
        - 'Mozilla/5.0 (compatible; bingbot/2.0; +http://www.bing.com/bingbot.htm)'
        - 'Sosospider+(+http://help.soso.com/webspider.htm)'
        - 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0); 360Spider(compatible; HaosouSpider; http://www.haosou.com/help/help_3_2.html'
        - 'Mozilla/5.0 (Linux; U; Android 4.0.2; en-us; Galaxy Nexus Build/ICL53F) AppleWebKit/534.30 (KHTML, like Gecko)Version/4.0 Mobile Safari/534.30; 360Spider'
    attack: pitchfork

    stop-at-first-match: true
    redirects: true
    max-redirects: 2

